import Task from "../task";
// import "./todo-list.css";

const TaskList = ({ todos }) => {
  const elements = todos.map((item) => {
    return <Task label={item.label} />;
  });

  return (
    <ul className="todo-list">
      <li>{elements}</li>
      {/* <li className="editing">
        <Task />
      </li>
      <li>
        <Task />
      </li> */}
    </ul>
  );
};

export default TaskList;
